import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

const store = {}
ReactDOM.render(
  <React.StrictMode>
    <Provider store = {store}>
    <App />
    </Provider>

  </React.StrictMode>,
  document.getElementById('root')
);
